  @override
  String get celtic_cross_screen_celtic_cross_explanation_dialog =>
      'ยซิฟีฅีฌีฟีกีฏีกีถ ีญีกีนยป โ 10 ึีกึีฟีกีถีธึ ีคีกีฝีกีพีธึีธึีฉีตีธึีถ ีง, ีธึีจ ีดีกีถึีกีดีกีฝีถีธึีฅีถ ีพีฅึีฌีธึีฎีธึีด ีง ีซึีกีพีซีณีกีฏีจ ีขีธีฌีธึ ีฏีธีฒีดีฅึีซึี ีถีฅึีฏีก ีฐีกีถีฃีกีดีกีถึีถีฅึีจ, ีญีธีนีจีถีคีธีฟีถีฅึีจ, ีถีฅึึีซีถ ึ ีกึีฟีกึีซีถ ีกีฆีคีฅึีธึีฉีตีธึีถีถีฅึีจ, ีซีถีนีบีฅีฝ ีถีกึ ีดีธีฟีกีฏีก ีคีซีถีกีดีซีฏีกีถ ึ ีพีฅึีปีถีกีฏีกีถ ีฅีฌึีจึ ีีกึีฟีฅึีจ ีคีกีฝีกีพีธึีพีธึีด ีฅีถ ีฐีฅีฟึีตีกีฌ ีฐีฅึีฉีกีฏีกีถีธึีฉีตีกีดีข.\n1 - ีีซีณีกีฏี ีฐีกึึีซ ีงีธึีฉีตีธึีถีจ ีกีตีฝีฟีฅีฒ ึ ีฐีซีดีกึ\n2 - ิดีชีพีกึีธึีฉีตีธึีถี ีกีตีถ, ีซีถีนีจ ึีฃีถีธึีด ีฏีกีด ีญีกีถีฃีกึีธึีด ีง ีกีผีกีป ีทีกึีชีพีฅีฌึ\n3 - ิฑีถีฐีกีตีฟ (ีกึีดีกีฟ)ี ีฉีกึีถีพีกีฎ ีทีกึีชีกีผีซีฉีถีฅึ ึ ีญีธึึีกีตีซีถ ีธึีชีฅึึ\n4 - ีีฅึีปีซีถ ีกีถึีตีกีฌีจี ีซึีกีคีกึีฑีธึีฉีตีธึีถีถีฅึ, ีธึีธีถึ ีฐีกีถีฃีฅึึีฅีฌ ีฅีถ ีถีฅึีฏีก ีคึีธึีฉีตีกีถีจึ\n5 - ิณีซีฟีกีฏึีกีฏีกีถ (ีถีบีกีฟีกีฏ)ี ีกีตีถ, ีซีถีนีซ ีพึีก ีกีตีชีด ีฏีฅีถีฟึีธีถีกึีกีฎ ีง ีฐีกึึีพีธีฒีจึ\n6 - ีีธีฟ ีกีบีกีฃีกี ีฐีกีพีกีถีกีฏีกีถ ีฆีกึีฃีกึีธึีด ีกีผีกีปีซีฏีก ีทีกีขีกีฉีถีฅึีซีถึ\n7 - ยซิตีฝ ีซีถึีฝยปี ีถีฅึึีซีถ ีพีซีณีกีฏ, ีผีฅีฝีธึึีฝีถีฅึ, ีพีฅึีกีขีฅึีดีธึีถึ ีฐีกึึีซีถึ\n8 - ีึีปีกีบีกีฟีจี ีดีกึีคีฏีกีถึ ึ ีฐีกีถีฃีกีดีกีถึีถีฅึีซ ีกีฆีคีฅึีธึีฉีตีธึีถีถีฅึึ\n9 - ีีธึีตีฝีฅึ / ีพีกีญีฅึี ีฝีบีกีฝีธึีดีถีฅึ, ีฏีกีฝีฏีกีฎีถีฅึ, ีธึีชีฅีฒ ีฆีฃีกึีดีธึีถึีถีฅึึ\n10 - ิฑึีคีตีธึีถึี ีฐีถีกึีกีพีธึ ีฅีฌึ, ีฅีฉีฅ ีดีซีฟีธึีดีถีฅึีจ ีบีกีฐีบีกีถีพีฅีถึ\nิฑีตีฝ ีคีกีฝีกีพีธึีธึีฉีตีธึีถีจ ีฉีธึีตีฌ ีง ีฟีกีฌีซีฝ ีฟีฅีฝีถีฅีฌ ยซีดีฅีฎ ีบีกีฟีฏีฅึีจยปี ีธึีฟีฅีฒ ีฅึ ีคีธึึ ีฏีกีถีฃีถีกีฎ, ีซีถีน ีง ีญีกีถีฃีกึีธึีด ีฏีกีด ึีฃีถีธึีด, ีธึีธีถึ ีฉีกึีถีพีกีฎ ีกีฆีคีกีฏีถีฅึีจ ีฃีธึีฎีธึีด ีฅีถ ีฅีฟีถีกีขีฅีดีธึีด ึ ีคีฅีบีซ ีธึึ ีง ีกีดีฅีถ ีซีถีน ีทีกึีชีพีธึีดึ\nิดีกีฝีกีพีธึีธึีฉีตีกีถ ีฝีญีฅีดีกีถ ีถีฅึีฏีกีตีกึีพีกีฎ ีง ีฝีฟ